description:
Verenigde Staten
Komedie / Horror
88 minuten

goed

met Jess Weixler, John Hensley en Josh Pais

De verlegen leerlinge Dawn (Jess Weixler) onderdrukt haar sexualiteit zo goed als maar kan om haar kuisheid te bewaren. Haar 
geloof wordt ernstig door haar stiefbroer Brad (John Hensley) belemmerd, die iedere keer opnieuw provoceert en haar ongewilde 
acties opdringt. Als zij dan het slachtoffer van een verkrachting wordt, bemerkt Dawn plotseling een abnormaliteit in haar 
eigen lichaam: ze blijkt namelijk tanden in haar vagina te bezitten.
